import React, {useEffect, useState} from 'react'

/*  子组件  */
function Child() {
  const [count, setCount] = useState(0)
  /* 
    开启和清除定时器
  */
  useEffect(() => {
    setInterval(()=>{
      setCount(count+1)
    })
  }, [])
  return (
    <div>
      <h2>{count}</h2>
      {/* <button onClick={}/> */}
    </div>
  )
}
export default function App() {
  
  
  return (
    <div>
       <Child />
    </div>
  )
}
